(1, 'যোগীহাটি খন্দকার নগর আর্দশ উচ্চ বিদ্যালয়  ', 'শিক্ষাই জাতির মেরুদন্ড', '০১/০১/২০০১ইং ', '১১৪১৬৩', '', 'Untitled-2.png', '', '০১৭১৪৬৪৫৮৩১', 'jogihati@gmail.com', 'ডাকঘরঃ যোগীহাটি, উপজেলা ঘাটাইল, জেলা টাঙ্গাইল   ।', 'www.chakariaummdm.edu.bd', 'যোগীহাটি খন্দকার নগর আর্দশ উচ্চ বিদ্যালয়  ', 'সকাল ৯:০০ থেকে বিকাল ৫:০০', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d58111.11116368186!2d89.87638801644033!3d24.45271260394183!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x39fdf3fd52b32929%3A0x19c899a719f212f7!2z4KaG4Kao4KeH4Ka54Kay4Ka-LOCmrOCmvuCmnOCmvuCmsA!5e0!3m2!1sen!2sbd!4v1475556566798\" width=\"600\" height=\"450\" frameborder=\"0\" style=\"border:0\" allowfullscreen></iframe>', '১২-১০-২০০১ সালে প্রতিষ্ঠাতা- প্রধান শিক্ষক জনাব খন্দকার মোঃ আঃ রহীম সাহেবের আহবানে যোগীহাটি গ্রামে একটি মাধ্যমিক স্তরের বিদ্যালয় স্থাপনের জন্য এলাকার গণ্যমান্য ব্যক্তিবর্গের উপস্থিতিতে একটি সভা অনুষ্ঠিত হয়। বিশিষ্টি শিক্ষানুরাগী জনাব খঃ আব্দুল মান্নান সাহেবের ভূমি দান ও যোগীহাটি গ্রামবাসীর সার্বিক সহযোগীতায় ২০০১ সালে যোগীহাটিতে একটি নিম্ন মাধ্যমিক বিদ্যালয় প্রতিষ্ঠিত হয়। বিদ্যালয়টি পরিচালনার জন্য বিশিষ্ট সমাজ সেবক খঃ হাফিজ উদ্দিন সাহেবকে প্রতিষ্ঠাতা সভাপতি নির্বাচিত করে একটি ম্যানেজিং কমিটি গঠন করা হয়। বিদ্যালয়টির ভবন -৩ কক্ষ বিশিষ্ট ২টি কাঁচা টিনের ঘর।  প্রাথমিক পাঠদানঃ ০১-০১-২০০৪ খ্রিঃ।', 'খঃ মোঃ আব্দুর রহীম', '০১৭১৬৭৭৫৩৩৩', 'jogihatikahschool@gmail.com', 'IMG_1347.jpg', 'IMG_1347.jpg', 'প্রতিষ্ঠানটি টাঙ্গাইল জেলার ঘাটাইল  উপজেলা কার্যালয়ের পাশে অবস্থিত । তদানীন্তন শিক্ষা বিবর্জিত এলাকায় শিক্ষা বিস্তারের প্রয়োজনে এলাকায় কতিপয় সচেতন মানুষের চেষ্টায় ফসল এই মাদ্‌রাসা । ১৯৮৯ ইং সালে প্রতিষ্ঠিত হয়ে অদ্যাবদি ছড়িয়ে যাচ্ছে বিদ্যার আলো । বর্তমান যুগ আধুনিক সভ্যতার যুগ , তথা কম্পিউটার যুগ । আধুনিক সভ্যতার  সাথে তাল মিলিয়ে কম্পিউটারের ব্যবহার চলছে এ মাদ্‌রাসাতেও । অতীত ঐতিহ্যকে ধারন করে , নুতুন সভ্যতার অংশ ছড়িয়ে ডিজিটাল বাংলাদেশ ‘ তথা স্বপ্নের বাংলাদেশ গড়তে সহায়তায় সফলকাম হবে মাদ্‌রাসাটি । আল্লাহ আমাদের তৌফিক দিন আমীন।', 'blankavatar.jpg', 'lightgreentheme', NULL, NULL, NULL);
