(55, 'ইতিহাস', 'history', NULL, 1, 4, '১২-১০-২০০১ সালে প্রতিষ্ঠাতা- প্রধান শিক্ষক জনাব খন্দকার মোঃ আঃ রহীম সাহেবের আহবানে যোগীহাটি গ্রামে একটি মাধ্যমিক স্তরের বিদ্যালয় স্থাপনের জন্য এলাকার গণ্যমান্য ব্যক্তিবর্গের উপস্থিতিতে একটি সভা অনুষ্ঠিত হয়। বিশিষ্টি শিক্ষানুরাগী জনাব খঃ আব্দুল মান্নান সাহেবের ভূমি দান ও যোগীহাটি গ্রামবাসীর সার্বিক সহযোগীতায় ২০০১ সালে যোগীহাটিতে একটি নিম্ন মাধ্যমিক বিদ্যালয় প্রতিষ্ঠিত হয়। বিদ্যালয়টি পরিচালনার জন্য বিশিষ্ট সমাজ সেবক খঃ হাফিজ উদ্দিন সাহেবকে প্রতিষ্ঠাতা সভাপতি নির্বাচিত করে একটি ম্যানেজিং কমিটি গঠন করা হয়। বিদ্যালয়টির ভবন -৩ কক্ষ বিশিষ্ট ২টি কাঁচা টিনের ঘর।', '1450401420', 0, 1, 1);
