(61, 'প্রতিষ্ঠান প্রধানের বার্তা', 'messageofheadteacher', NULL, 88, 88, 'প্রতিষ্ঠানটি টাঙ্গাইল জেলার ঘাটাইল উপজেলা কার্যালয়ের পাশে অবস্থিত । তদানীন্তন শিক্ষা বিবর্জিত এলাকায় শিক্ষা বিস্তারের প্রয়োজনে এলাকায় কতিপয় সচেতন মানুষের চেষ্টায় ফসল এই মাদ্‌রাসা । ১৯৮৯ ইং সালে প্রতিষ্ঠিত হয়ে অদ্যাবদি ছড়িয়ে যাচ্ছে বিদ্যার আলো । বর্তমান যুগ আধুনিক সভ্যতার যুগ , তথা কম্পিউটার যুগ । আধুনিক সভ্যতার সাথে তাল মিলিয়ে কম্পিউটারের ব্যবহার চলছে এ মাদ্‌রাসাতেও । অতীত ঐতিহ্যকে ধারন করে , নুতুন সভ্যতার অংশ ছড়িয়ে ডিজিটাল ল বাংলাদেশ ‘ তথা স্বপ্নের বাংলাদেশ গড়তে সহায়তায় সফলকাম হবে মাদ্‌রাসাটি । আল্লাহ আমাদের তৌফিক দিন আমীন।', '1450938847', 0, 1, 1),
